    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    return {
      success: true,
      action: "Navigated to the Profile page from the sidebar",
      extractedData: {
        currentPage: await page.title() // Extracting the title to verify navigation
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
